import React from "react";

const animation = () => {
  let animate = () => {
    var evt = new MouseEvent("click", {
      view: window,
      bubbles: true,
      cancelable: true,
      clientX: 20,
      /* whatever properties you want to give it */
    });
    console.log("Hello");
    let animation = document.getElementsByClassName("ANNHomeAnimation")[0];
    animation.dispatchEvent(evt);
  };

  return (
    <div className="ANOuterDiv">
      <iframe
        className="ANNHomeAnimation"
        src="https://my.spline.design/buildingsunsetcopy-a0755fe79ab59dc655f24e1c6b5575b4/"
        frameborder="0"
        width="1000px"
        height="650px"
      ></iframe>
      <button onClick={animate}>Click</button>
    </div>
  );
};

export default animation;
